    <style data-savepage-href="/tours/1022/a/css/style.min.css"
           type="text/css">article, aside, details, figcaption, figure, footer, header, hgroup, main, nav, section, summary {
        display: block
    }

    audio, canvas, video {
        display: inline-block
    }

    audio:not([controls]) {
        display: none;
        height: 0
    }

    [hidden] {
        display: none
    }

    html {
        font-family: sans-serif;
        -ms-text-size-adjust: 100%;
        -webkit-text-size-adjust: 100%
    }

    body {
        margin: 0
    }

    a:focus {
        outline: thin dotted
    }

    a:active, a:hover {
        outline: 0
    }

    h1 {
        font-size: 2em;
        margin: .67em 0
    }

    abbr[title] {
        border-bottom: .0625rem dotted
    }

    dfn {
        font-style: italic
    }

    hr {
        -moz-box-sizing: content-box;
        box-sizing: content-box;
        height: 0
    }

    mark {
        background: #ff0;
        color: #000
    }

    code, kbd, pre, samp {
        font-family: monospace, serif;
        font-size: 1em
    }

    pre {
        white-space: pre-wrap
    }

    q {
        quotes: "\201C" "\201D" "\2018" "\2019"
    }

    small {
        font-size: 80%
    }

    sub, sup {
        font-size: 75%;
        line-height: 0;
        position: relative;
        vertical-align: baseline
    }

    sup {
        top: -.5em
    }

    sub {
        bottom: -.25em
    }

    img {
        border: 0
    }

    svg:not(:root) {
        overflow: hidden
    }

    figure {
        margin: 0
    }

    fieldset {
        border: .0625rem solid silver;
        margin: 0 .125rem;
        padding: .35em .625em .75em
    }

    legend {
        border: 0;
        padding: 0
    }

    button, input, select, textarea {
        font-family: inherit;
        font-size: 100%;
        margin: 0
    }

    button, input {
        line-height: normal
    }

    button, select {
        text-transform: none
    }

    button, html input[type=button], input[type=reset], input[type=submit] {
        -webkit-appearance: button;
        cursor: pointer
    }

    button[disabled], html input[disabled] {
        cursor: default
    }

    input[type=checkbox], input[type=radio] {
        box-sizing: border-box;
        padding: 0
    }

    input[type=search] {
        -webkit-appearance: textfield;
        -moz-box-sizing: content-box;
        -webkit-box-sizing: content-box;
        box-sizing: content-box
    }

    input[type=search]::-webkit-search-cancel-button, input[type=search]::-webkit-search-decoration {
        -webkit-appearance: none
    }

    button::-moz-focus-inner, input::-moz-focus-inner {
        border: 0;
        padding: 0
    }

    textarea {
        overflow: auto;
        vertical-align: top
    }

    table {
        border-collapse: collapse;
        border-spacing: 0
    }

    html {
        text-rendering: geometricPrecision;
        -webkit-font-smoothing: antialiased
    }

    .step, body, form, html {
        height: 100%;
        width: 100%
    }

    body {
        position: relative;
        font-family: Roboto, Arial, sans-serif;
        color: #fff;
        background-color: #fff;
        -webkit-transition: background-color .1s ease-out 1s;
        -moz-transition: background-color .1s ease-out 1s;
        -o-transition: background-color .1s ease-out 1s;
        transition: background-color .1s ease-out 1s
    }

    h1, h2, h3, h4, h5, h6 {
        font-weight: 400
    }

        -webkit-tap-highlight-color: transparent;

    }

    .results__spinner__inner label {

    }

    .results__spinner__inner label:nth-child(6) {

    }

    .results__spinner__inner label:nth-child(5) {
        -webkit-animation: lol 3s .1s infinite ease-in-out;

    }

    .results__spinner__inner label:nth-child(4) {

    }

    .results__spinner__inner label:nth-child(3) {

    .results__spinner__inner label:nth-child(2) {

    .step[data-effect=zoom] {
        -webkit-transform: scale(0);
        -moz-transform: scale(0);
        -ms-transform: scale(0);
        -o-transform: scale(0);
        transform: scale(0)
    }

    .step[data-effect=left] {
        -webkit-transform: translateX(100%);
        -moz-transform: translateX(100%);
        -ms-transform: translateX(100%);
        -o-transform: translateX(100%);
        transform: translateX(100%)
    }

    .step[data-effect=up] {
        -webkit-transform: translateY(100%);
        -moz-transform: translateY(100%);
        -ms-transform: translateY(100%);
        -o-transform: translateY(100%);

    }

    .step[data-effect=turn] {

    }

        -o-transform: none;

    @-webkit-keyframes lol {

        33% {

        }
        66% {

        }
        100% {
